function Square (props) {

    return (<div className='square' style={{backgroundColor: props.color}}>
          {props.info.title}<br/>
          <span>{props.info.description}</span><br/>
          {
              props.info.links.map(link => <button className='btn'><a href='https://xd.adobe.com/view/5bee77bc-6104-48b2-b6ab-e0dbcecbaaf7-0ebd/' >Adobe XD</a></button>)
          }

        </div>);

}

export default Square
